import React from "react";
import { kurtis } from "../assets";
import { CategoryCard } from "./CategoryCard";

export const Categories = () => {
  const categories = [
    {
      name: "Kurta",
      img: kurtis,
    },
    {
      name: "Kurta",
      img: kurtis,
    },
  ];
  return (
    <div className="grid grid-col-6 gap-4 p-10">
      {categories.map((category) => (
        <CategoryCard key={categories.indexOf(category)} category={category} />
      ))}
    </div>
  );
};
